import 'core-js'
import React from 'react';
import './index.scss'

/*
* 组件：按钮组
* params
*style:样式
* func:方法
* details:内容
* type:按钮颜色类型
* size:按钮大小
* */
class Button extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            style : props.style,
            func : props.func,
            details : props.details,
            type: props.type,
            size: props.size
        }
    }



    /*
    * type类型选择
    * */

    TypeSelect = () => {
        let Button = 'Button';
        console.log(this.state.type)
        switch(this.state.type)
        {
            case 'normal':
               Button =  'normal'
               break;
            case 'primary':
                Button = 'primary'
                break;
            default:
                console.log('Button属性赋值不合法')

        }
        console.log(Button);
        this.setState({Button:Button})
    }

    /*
    * 鼠标移入
    * */
    MouseEnter = (event) => {
        $(event.target).addClass('Button_mouse_enter')
    }

    componentDidMount(){
        this.TypeSelect()
    }

    render(){
        return (
            <button className={"ButtonBase "+this.state.Button} onMouseEnter={MouseEnter}  style={this.state.style} onClick={this.state.func}>
                {this.state.details}
            </button>
        )
    }
}

/*
 * 组件默认属性
 * */
Button.dedaultProps ={
    type:'normal',
    size:'normal'
}
export {
   Button
};
